import { all } from 'axios';
import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom'

function PoolHome() {
    const navigate = useNavigate();
    const [section, setSection] = useState(true);
    const [allPool, setallPool] = useState([]);

    useEffect(() => {
      fetch("http://localhost:8081/allpool")
        .then(response => response.json())
        .then(data => setallPool(data))
        .catch(error => console.log(error));
    }, []);
    
  return (
    <>
    <button onClick={()=>{setSection(true)}}>Available Pools</button>
    <button onClick={()=>{setSection(false)}}>My Pools</button>

<div>
  {section ? 
  <>
    <div>These are available pools</div>
    <div>
      {allPool.map(item => (
        <div key={item.id} onClick={() => handleClick(item)}>
          <p>{item.name}</p>
          <p>{item.email}</p>
        </div>
      ))}
    </div>
  </>
  :
  <>
    <div>
      These are my pools
    </div>
      </>
  }
</div>

      <div>
        <button onClick={()=>{navigate('/signup')}}>LOGOUT</button>
    </div>
    </>
  )
}

export default PoolHome
